core::slice::<impl [T]>::iter.doc:
Returns an iterator over the slice.

The iterator yields all items from start to end.

# Examples

```
let x = &[1, 2, 4];
let mut iterator = x.iter();

assert_eq!(iterator.next(), Some(&1));
assert_eq!(iterator.next(), Some(&2));
assert_eq!(iterator.next(), Some(&4));
assert_eq!(iterator.next(), None);
```

core::iter::Iterator::map.doc:
Takes a closure and creates an iterator which calls that closure on each
element.

`map()` transforms one iterator into another, by means of its argument:
something that implements [`FnMut`]. It produces a new iterator which
calls this closure on each element of the original iterator.

If you are good at thinking in types, you can think of `map()` like this:
If you have an iterator that gives you elements of some type `A`, and
you want an iterator of some other type `B`, you can use `map()`,
passing a closure that takes an `A` and returns a `B`.

`map()` is conceptually similar to a [`for`] loop. However, as `map()` is
lazy, it is best used when you're already working with other iterators.
If you're doing some sort of looping for a side effect, it's considered
more idiomatic to use [`for`] than `map()`.

[`for`]: ../../book/ch03-05-control-flow.html#looping-through-a-collection-with-for

# Examples

Basic usage:

```
let a = [1, 2, 3];

let mut iter = a.iter().map(|x| 2 * x);

assert_eq!(iter.next(), Some(2));
assert_eq!(iter.next(), Some(4));
assert_eq!(iter.next(), Some(6));
assert_eq!(iter.next(), None);
```

If you're doing some sort of side effect, prefer [`for`] to `map()`:

```
# #![allow(unused_must_use)]
// don't do this:
(0..5).map(|x| println!("{x}"));

// it won't even execute, as it is lazy. Rust will warn you about this.

// Instead, use a for-loop:
for x in 0..5 {
    println!("{x}");
}
```

core::iter::Iterator::sum.doc:
Sums the elements of an iterator.

Takes each element, adds them together, and returns the result.

An empty iterator returns the *additive identity* ("zero") of the type,
which is `0` for integers and `-0.0` for floats.

`sum()` can be used to sum any type implementing [`Sum`][`core::iter::Sum`],
including [`Option`][`Option::sum`] and [`Result`][`Result::sum`].

# Panics

When calling `sum()` and a primitive integer type is being returned, this
method will panic if the computation overflows and overflow checks are
enabled.

# Examples

```
let a = [1, 2, 3];
let sum: i32 = a.iter().sum();

assert_eq!(sum, 6);

let b: Vec<f32> = vec![];
let sum: f32 = b.iter().sum();
assert_eq!(sum, -0.0_f32);
```

alloc_crate::collections::VecDeque::<T,.doc:
Reserves capacity for at least `additional` more elements to be inserted in the given
deque. The collection may reserve more space to speculatively avoid frequent reallocations.

# Panics

Panics if the new capacity overflows `usize`.

# Examples

```
use std::collections::VecDeque;

let mut buf: VecDeque<i32> = [1].into();
buf.reserve(10);
assert!(buf.capacity() >= 11);
```

core::iter::IntoIterator::into_iter.doc:
Creates an iterator from a value.

See the [module-level documentation] for more.

[module-level documentation]: crate::iter

# Examples

```
let v = [1, 2, 3];
let mut iter = v.into_iter();

assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());
assert_eq!(None, iter.next());
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

core::iter::Extend::extend.doc:
Extends a collection with the contents of an iterator.

As this is the only required method for this trait, the [trait-level] docs
contain more details.

[trait-level]: Extend

# Examples

```
// You can extend a String with some chars:
let mut message = String::from("abc");

message.extend(['d', 'e', 'f'].iter());

assert_eq!("abcdef", &message);
```

